import React from 'react';

function Food({ name }) {
  return (
    <h1>I like {name}</h1>
  );
}

const foorILike = [
  {
    id:1,
    name:'kim'},
  {
    id:2,
    name:'park'},
  {
    id:3,
    name:'choe'
  }
];

function renderFood(dish) {
  console.log(dish)
  return <Food key={dish.id} name={dish.name} />
}

function App() {
  return (
    <div>
      {foorILike.map(renderFood)}
    </div>
  );
}

export default App;
